const Home = () => {
  return (
    <div>
    <Nav />
      <div className="pt3 containertosin">

        <div className='row1'>
          <div className='box1 box'>
            <img className = 'content imagebox' alt='friends' src="./1-min.jpg"/>
            <div className='contenttext'>CONTENT</div>
          </div>
          <div className='box2 box'>
            <img className = 'portraits imagebox' alt='beauty' src="./6-min.jpg"/>
            <div className='portraitstext'>PORTRAITS</div>
          </div>
        </div>


        <div className='row2'>
        <a href="">
          <div className='box3 box'>
            <img className = 'family imagebox' alt='mama' src="./11-min.jpg"/>
            <div className='familytext'>FAMILY</div>
          </div> </a>
          <div className='box4 box'>
            <img className = 'products imagebox' alt='towels' src="./image.jpg.png"/>
            <div className='productstext'>PRODUCTS</div>
          </div>
        </div>
      </div>
    </div>
  )
}











export default Home;
